import React from 'react';
import "./Sixth.css";

const Sixth = () => {
  return (
    
        <div className='container'>
            <div className='row'>
            <div className='col-md-12 sixth-content'>
            <h4>"Providing the elders the care they deserve by improving<br/>
                 their quality of living is our motto and each and every<br/>
                  one of us at Athulya are integral to this cause"</h4>
        </div>
            </div>
        </div>
        
  )
}

export default Sixth
